import React from "react";
import Image from "./image";
import { DefaultInput } from "../form/input-fields/primary-input";
import { ContentWrapper, CustomButton, ContentContainer, HeaderContainer, CenteredForm, FormContainer, Title, SubTitle, InputContainer } from "./elements";
import styled from "styled-components";
import colors from "../../theme/main/colors";

const CenteredContentContainer = styled("a")`
justify-content:center;
text-align:center;

}
`;


const GoodToGo = () => {

    return (
        <>
            <ContentWrapper>
                <Image />
                <FormContainer>
                    <CenteredForm>
                        <HeaderContainer>
                            <Title>Signup with Taxiye</Title>
                            <SubTitle>Tell us who you are. Please enter your correct detail below</SubTitle>
                        </HeaderContainer>
                        <CenteredContentContainer>
                            <InputContainer>
                                <DefaultInput
                                    label="First Name *"
                                    placeholder="John"
                                    id="firstname" />
                            </InputContainer>
                            <InputContainer>
                                <DefaultInput
                                    label="Last Name *"
                                    placeholder="Doe"
                                    id="lastname" />
                            </InputContainer>
                            <InputContainer>
                                <DefaultInput
                                    label="Email Address *"
                                    placeholder="Johndoe@gmail.com"
                                    id="emailaddress" />
                            </InputContainer>

                                <CustomButton>Continue to Taxiye</CustomButton>
                        </CenteredContentContainer>
                    </CenteredForm>
                </FormContainer>


            </ContentWrapper>
        </>
    );
};

export default GoodToGo;
